import React from "react";

const quality = require("../assets/quality.png").default;

const Promise = () => {
  return (
    <div className="bg-light d-flex justify-content-center" style={styles.card}>
      <div style={{ textAlign: "center", alignItems: "center" }}>
        <img style={styles.icon} src={quality} />
      </div>
      <p>Highest Quality Standard</p>
    </div>
  );
};

const styles = {
  card: {
    width: 400,

    margin: 20,
    justifyContent: "center",
  },
  icon: {
    width: 40,
    margin: 30,
  },
};

export default Promise;
